import React from "react";
import ReactBodymovin from "react-bodymovin";
import animation from "./blood.json";
import lgHeader from "./lgHeader.json";
import "./HomeBlocks.css";
const Icons = () => {
  const iconOne = {
    loop: false,
    autoplay: true,
    prerender: true,
    animationData: animation
  };
  const iconTwo = {
    loop: false,
    autoplay: true,
    prerender: true,
    animationData: lgHeader
  };

  return (
    <div className="HomeBlocks">
      <div className="IconAndText">
        <div className="svg">
          <ReactBodymovin options={iconOne} />
        </div>
        <p>ICon Name</p>
      </div>

      <div className="IconAndText">
        <div className="svg">
          <ReactBodymovin options={iconOne} />
        </div>
        <p>Icon Name 2 </p>
      </div>
    </div>
  );
};

export default Icons;
